import React from 'react'


const OutlineCourse = (props) => {
  return (
    <div>
         <div className='outline-list'>
                {link.map((link) => (
                    <ul>
                        <li key={link.id}>
                            {link.list}
                        </li>
                    </ul>
                ))}
                </div>
                <div className='outline-item'>
                    <h2>Nothing for now</h2>
                </div>
    </div>
  )
}

export default OutlineCourse
